import style from './TodoForm.module.css';

function TodoForm() {
  return (
    <div>
      <form>
        <input type="text" className={style.mainInput} />
        <button className={style.submitButton}>Submit</button>
      </form>
    </div>
  );
}

export default TodoForm;
